description:
@dundurnmarket stands with Ukraine. 

Starting today, all the proceeds of our gluten-free carrot cupcakes will benefit @doctorswithoutborders and their emergency medical and humanitarian work in Ukraine. 

That's a $4 donation for every cupcake sold, at any of our locations @ottawamarket
@strathconamarkethamont

For more information: www.doctorswithoutborders.org

We appreciate your support❤🇺🇦
